{
  "class_id": "0x01",
  "message_id": "0x03",
  "message_name": "UBX-NAV-STATUS",
  "description": "Receiver navigation status",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 16
  },
  "payload_contents": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch."
    },
    {
      "byte_offset": 4,
      "data_type": "U1",
      "name": "gpsFix",
      "description": "GPSfix Type, this value does not qualify a fix as valid and within the limits. See note on flag gpsFixOk below.\n0x00 = no fix\n0x01 = dead reckoning only\n0x02 = 2D-fix\n0x03 = 3D-fix\n0x04 = GPS + dead reckoning combined\n0x05 = Time only fix\n0x06..0xff = reserved"
    },
    {
      "byte_offset": 5,
      "data_type": "X1",
      "name": "flags",
      "description": "Navigation Status Flags",
      "bitfield_subfields": [
        {
          "name": "GPSfixOK",
          "description": "1 = Fix within limits (e.g. DOP & accuracy)",
          "bit_offset": 0,
          "bit_length": 1
        },
        {
          "name": "DiffSoln",
          "description": "1 = DGPS used",
          "bit_offset": 1,
          "bit_length": 1
        },
        {
          "name": "WKNSET",
          "description": "1 = Valid GPS week number",
          "bit_offset": 2,
          "bit_length": 1
        },
        {
          "name": "TOWSET",
          "description": "1 = Valid GPS time of week (ITOW & fTOW)",
          "bit_offset": 3,
          "bit_length": 1
        },
        {
          "name": "Reserved",
          "description": "Reserved",
          "bit_offset": 4,
          "bit_length": 4,
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 6,
      "data_type": "X1",
      "name": "fixStat",
      "description": "Fix Status Information",
      "bitfield_subfields": [
        {
          "name": "diffCorr",
          "description": "1 = differential corrections available",
          "bit_offset": 0,
          "bit_length": 1
        },
        {
          "name": "carrSolnValid",
          "description": "1 = valid carrSoln",
          "bit_offset": 1,
          "bit_length": 1
        },
        {
          "name": "mapMatching",
          "description": "map matching status:\n00: none\n01: valid but not used, i.e. map matching data was received, but was too old\n10: valid and used, map matching data was applied\n11: valid and used, map matching data was applied. In case of sensor unavailability map matching data enables dead reckoning. This requires map matched latitude/longitude or heading data.",
          "bit_offset": 2,
          "bit_length": 2,
          "values": [
            { "value": 0, "description": "none" },
            { "value": 1, "description": "valid but not used" },
            { "value": 2, "description": "valid and used" },
            { "value": 3, "description": "valid and used (dead reckoning enabled)" }
          ]
        },
        {
          "name": "Reserved",
          "description": "Reserved",
          "bit_offset": 4,
          "bit_length": 4,
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 7,
      "data_type": "X1",
      "name": "flags2",
      "description": "further information about navigation output",
      "bitfield_subfields": [
        {
          "name": "psmState",
          "description": "power save mode state:\n0: ACQUISITION [or when psm disabled]\n1: TRACKING\n2: POWER OPTIMIZED TRACKING\n3: INACTIVE",
          "bit_offset": 0,
          "bit_length": 2,
          "values": [
            { "value": 0, "description": "ACQUISITION [or when psm disabled]" },
            { "value": 1, "description": "TRACKING" },
            { "value": 2, "description": "POWER OPTIMIZED TRACKING" },
            { "value": 3, "description": "INACTIVE" }
          ]
        },
        {
          "name": "spoofDetState",
          "description": "Spoofing detection state (not supported in protocol versions less than 18)\n0: Unknown or deactivated\n1: No spoofing indicated\n2: Spoofing indicated\n3: Multiple spoofing indications",
          "bit_offset": 2,
          "bit_length": 3,
          "values": [
            { "value": 0, "description": "Unknown or deactivated" },
            { "value": 1, "description": "No spoofing indicated" },
            { "value": 2, "description": "Spoofing indicated" },
            { "value": 3, "description": "Multiple spoofing indications" }
          ]
        },
        {
          "name": "carrSoln",
          "description": "Carrier phase range solution status:\n0: no carrier phase range solution\n1: carrier phase range solution with floating ambiguities\n2: carrier phase range solution with fixed ambiguities",
          "bit_offset": 5,
          "bit_length": 3,
          "values": [
            { "value": 0, "description": "no carrier phase range solution" },
            { "value": 1, "description": "carrier phase range solution with floating ambiguities" },
            { "value": 2, "description": "carrier phase range solution with fixed ambiguities" }
          ]
        }
      ]
    },
    {
      "byte_offset": 8,
      "data_type": "U4",
      "name": "ttff",
      "unit": "ms",
      "description": "Time to first fix (millisecond time tag)"
    },
    {
      "byte_offset": 12,
      "data_type": "U4",
      "name": "msss",
      "unit": "ms",
      "description": "Milliseconds since Startup / Reset"
    }
  ]
}
